import AnswerItem from "./AnswerItem";
import { Answer } from "../types";

const AnswersList = ({ answers }: any) => {
  return (
    <div>
      <ul>
        {answers.map((answer: any) => (
          <li key={answer.id}>
              <div>
                <h4>{answer.user}</h4>
                <p>{answer.content}</p>
                <time>{answer.created}</time>
              </div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default AnswersList;
